import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Header from '../components/Header';
import Sidebar from '../components/Sidebar';
import Footer from '../components/Footer';
import { useNavigate } from 'react-router-dom';

const Wallet = ({ userInfo, handleLogout }) => {
    const [commissionAmount, setCommissionAmount] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        fetchCommissionAmount();
    }, []);

    const fetchCommissionAmount = async () => {
        try {
            const response = await axios.post('/reselleradmin/FetchCommissionAmtReseller', {
                user_id: userInfo.data.user_id,
            });
            console.log(response.data); // Check response data structure in console
            if (response.status === 200) {
                setCommissionAmount(response.data.data);
            } else {
                console.log('Failed to fetch commission amount');
            }
        } catch (error) {
            console.error('Error fetching commission amount:', error);
        }
    };

    const goBack = () => {
        navigate(-1);
    };

    return (
        <div className='container-scroller'>
            <Header userInfo={userInfo} handleLogout={handleLogout} />
            <div className="container-fluid page-body-wrapper">
                <Sidebar />
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Wallet</h3>
                                    </div>
                                    <div className="col-12 col-xl-4">
                                        <div className="justify-content-end d-flex">
                                            <button
                                                type="button"
                                                className="btn btn-success"
                                                onClick={goBack}
                                                style={{ marginRight: '10px' }}
                                            >
                                                Go Back
                                            </button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                    <div className="col-md-6 mb-4 stretch-card transparent">
                                        <div className="card card-tale">
                                            <div className="card-body">
                                                <h3 className="mb-4">Wallet Balance</h3>
                                                <h3 className="fs-30 mb-2"> <b>{commissionAmount}.Rs</b></h3>
                                            </div>
                                        </div>
                                    </div>
                                    <div className="col-md-6 mb-4 stretch-card transparent">
                                        <div className="card card-dark-blue">
                                            <div className="card-body">
                                                <p className="mb-4 fs-30">Withdraw</p>
                                                <button>click here</button>

                                            </div>
                                        </div>
                                    </div>


                                    </div>
                                </div>
                            </div>
                        </div>

                    </div>
                    <Footer />
                </div>
            </div>
        </div>
    );
};

export default Wallet;
